// FUNÇÃO DE DESENHO

void inseririmagem(int x, int y, int metodo, unsigned char *imagem) {
     int i, altura, largura;
     int coluna=0;
     int linha=0;
     largura=(imagem[0]*256+imagem[1]);
     altura=(imagem[2]*256+imagem[3]);
     for(i=(metodo==0?4:largura*altura*3+4);(metodo==0 && i<=(largura*altura)*3+4) || (metodo!=0 && i>=3);i+=(metodo==0?3:-3)) {        
        if((metodo==0 && linha<altura-1) || (metodo!=0 && linha>0)) {
            if(imagem[i]!=0 || imagem[i+1]!=0 || imagem[i+2]!=0) { 
              putpixel(coluna+x,linha+y,COLOR(imagem[i+2],imagem[i+1],imagem[i]));
            }
        }
        coluna++;
        if(coluna>=largura) {
            linha++;
            coluna=0;
        }        
     }          
}




